import update from "./CoinPortfolio";
import { Card,  Button } from "react-bootstrap";

function assetDetails() {

    return(
        <div>

<Card.Header>
                Cryptocurrency
            </Card.Header>

            <Button
                className="btn btn-success" onClick={this.addAssetPortfolio}>
                Add to portfolio!
            </Button>

        </div>
    )

}

export default assetDetails;
